import ExpenseItem from "./ExpenseItem"
import './Expenses.css'

function Expenses (props) {
    const expensesList=[]
    props.data.forEach((expense, index) => {
      expensesList.push(<ExpenseItem key={index} expenseData={expense} />)

    });

    return(
        <div className="expenses">
          {expensesList}
        </div>
    )
}

export default Expenses
